	static std::vector<std::string> GetAssetCategories(AssetGender gender = AssetGender::FEMALE)
	{
		std::vector<std::string> cats;
		for (const auto& a : g_MetaPedAssets)
		{
			if (a.gender == gender)
				if (std::find(cats.begin(), cats.end(), a.category) == cats.end())
					cats.push_back(a.category);
		}
		std::sort(cats.begin(), cats.end());
		return cats;
	}

	static std::vector<const MetaPedAsset*> GetAssetsByCategory(const std::string& cat, AssetGender gender = AssetGender::FEMALE)
	{
		std::vector<const MetaPedAsset*> result;
		for (const auto& a : g_MetaPedAssets)
			if (a.category == cat && a.gender == gender)
				result.push_back(&a);
		return result;
	}

	static std::vector<const MetaPedAsset*> SearchAssets(const std::string& term, AssetGender gender = AssetGender::FEMALE)
	{
		std::vector<const MetaPedAsset*> result;
		std::string lower = term;
		std::transform(lower.begin(), lower.end(), lower.begin(), ::tolower);
		for (const auto& a : g_MetaPedAssets)
		{
			if (a.gender != gender)
				continue;
			std::string name = a.name;
			std::transform(name.begin(), name.end(), name.begin(), ::tolower);
			if (name.find(lower) != std::string::npos)
				result.push_back(&a);
		}
		return result;
	}
